window.bookSummaryJSON = "<p><b>Katie has reached the fifth floor of the dungeon and met with the ruler of the Abyss</b>, <b>where she learned that her previous actions have rendered her fetch quest uncompletable.</b></p> <p>Rather than give in to despair, she’s decided on a new quest: to escape the dungeon she’s trapped in, and defeat the demon lord herself.</p> <p>With her body already warped into something inhuman, gaining a third class that has some rather detrimental effects on the fabric of reality doesn’t help her stay grounded. It does, however, grant her even more power. Will there be anything in the real world capable of standing up to her?</p>"; 
